   t2."DP" AS "DP"
  FROM
   "DT_node_lookup_23" AS t1
   LEFT OUTER JOIN
   "DT_node_data_23" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_24" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_6", t1."Leaf_7", t1."Leaf_8", t1."Leaf_11", t1."Leaf_15", t1."Leaf_17", t1."Leaf_20", t1."Leaf_21", t1."Leaf_24", t1."Leaf_25", t1."Leaf_26", t1."Leaf_27", t1."Leaf_28", t1."Leaf_34", t1."Leaf_35", t1."Leaf_36", t1."Leaf_39", t1."Leaf_45", t1."Leaf_46", t1."Leaf_50", t1."Leaf_51", t1."Leaf_52", t1."Leaf_55", t1."Leaf_56", t1."Leaf_57", t1."Leaf_59", t1."Leaf_60", t1."Leaf_61", t1."Leaf_62", t1."Leaf_65", t1."Leaf_68", t1."Leaf_69", t1."Leaf_70", t1."Leaf_71", t1."Leaf_72", t1."Leaf_73", t1."Leaf_74", t1."Leaf_76", t1."Leaf_79", t1."Leaf_81", t1."Leaf_83", t1."Leaf_87", t1."Leaf_88", t1."Leaf_90", t1."Leaf_91", t1."Leaf_92", t1."Leaf_100", t1."Leaf_101", t1."Leaf_102", t1."Leaf_108", t1."Leaf_109", t1."Leaf_112", t1."Leaf_113", t1."Leaf_114", t1."Leaf_115", t1."Leaf_116", t1."Leaf_117", t1."Leaf_118", t1."Leaf_119", t1."Leaf_120", t1."Leaf_121", t1."Leaf_124", t1."Leaf_125", t1."Leaf_126" ) AS node_id
  FROM
    "model_input" AS t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_33" > 2.500000) AND (t."X_35" <= 0.500000) AND (t."X_10" > 3.500000)) THEN 6 ELSE NULL END AS "Leaf_6",
      CASE WHEN((t."X_33" > 2.500000) AND (t."X_35" <= 0.500000) AND (t."X_10" <= 3.500000) AND (t."X_42" <= 13.500000)) THEN 7 ELSE NULL END AS "Leaf_7",
      CASE WHEN((t."X_33" > 2.500000) AND (t."X_35" <= 0.500000) AND (t."X_10" <= 3.500000) AND (t."X_42" > 13.500000)) THEN 8 ELSE NULL END AS "Leaf_8",
      CASE WHEN((t."X_33" > 2.500000) AND (t."X_35" > 0.500000) AND (t."X_62" <= 0.500000) AND (t."X_58" <= 0.500000)) THEN 11 ELSE NULL END AS "Leaf_11",
